import React from "react";

function List() {
  return (
    <>
      <h2>Hello I am list component</h2>
      <ol>
        <li>One</li>
        <li>Two</li>
        <li>Three</li>
        <li>Four</li>
      </ol>
      <ul>
        <li>One</li>
        <li>Two</li>
        <li>Three</li>
        <li>Four</li>
      </ul>
    </>
  );
}

export default List;
